import card from './Card.js'
import Button from 'react-bootstrap/Button';

function GridExample() {
  return (
    <Row>
      <Col lg={12}>
        <Button variant="primary">Go somewhere</Button>
      </Col>
    </Row>
  );
}

export default GridExample;
